import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
// Import images as before

function Header() {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setMobileMenuOpen(!mobileMenuOpen);
  };

  return (
    <header className="main-header">
      <div className="header-left">
        <Link to="/">
          <img src="/images/nsbe-logo.png" alt="NSBE Logo" className="nsbe-logo" />
        </Link>
      </div>
      <div className="header-right">
        <nav className="desktop-nav">
          <ul>
            <li><Link to="/">Welcome</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/timeline">Timeline</Link></li>
            <li className="dropdown">
              <a href="#" className="dropbtn">Programming</a>
              <div className="dropdown-content">
                <Link to="/awards">Awards</Link>
                <Link to="/competitions">Competitions</Link>
              </div>
            </li>
          </ul>
        </nav>
        {/* Rest of the header */}
      </div>
      {/* Mobile Hamburger Icon */}
      <div className="hamburger" onClick={toggleMobileMenu}>
        <div></div>
        <div></div>
        <div></div>
      </div>
      {/* Mobile Navigation Menu */}
      {mobileMenuOpen && (
        <div className="mobile-nav">
          <Link to="/" onClick={toggleMobileMenu}>Welcome</Link>
          <Link to="/about" onClick={toggleMobileMenu}>About</Link>
          <Link to="/timeline" onClick={toggleMobileMenu}>Timeline</Link>
          <Link to="/awards" onClick={toggleMobileMenu}>Awards</Link>
          <Link to="/competitions" onClick={toggleMobileMenu}>Competitions</Link>
        </div>
      )}
    </header>
  );
}

export default Header;
